import logo from './logo.svg';
import './App.css';
import {Header} from './Header'
import {Footer} from './Footer';
import {Content} from './Content';


function App() {
  return (
    <div className='App'>
      <div class="header">
       <p>mobile</p>
      </div>

      <div class="Content">
        <Content/>
      </div>

      <div class="footer">
        <p>Footer</p>
      </div>
    </div>
  );
}

export default App;
